(1, 1, 'Tesla overtakes Volkswagen as value hits $100bn', 'tesla-overtakes-volkswagen-as-value-hits-100bn', '<p><span style=\"color: #404040; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 16px; font-weight: bold;\">Tesla has displaced Volkswagen as the world\'s second most valuable carmaker, after a dramatic rise in share price pushed its market value to more than $100bn (&pound;76.1bn).</span></p>\n<p>&nbsp;</p>\n<p><span style=\"color: #404040; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 16px; font-weight: bold;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"2020 Volkswagen Passat.jpg\" src=\"data:image/jpeg;base64,\" alt=\"\" width=\"813\" height=\"457\" /></span></p>\n<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 23px 0px 0px; padding: 0px; vertical-align: baseline;\">The milestone sets the stage for chief Elon Musk to collect billions in pay tied to hitting that target.</p>\n<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 18px 0px 0px; padding: 0px; vertical-align: baseline;\">Tesla\'s share price has more than doubled since October, when&nbsp;<a class=\"story-body__link\" style=\"border-width: 0px 0px 1px; border-image: initial; color: #222222; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-family: inherit; font-size: 1rem; font-weight: bold; letter-spacing: inherit; line-height: 1.375; margin: 0px; padding: 0px; vertical-align: baseline; text-decoration-line: none; -webkit-tap-highlight-color: rgba(17, 103, 168, 0.3); border-color: initial initial #dcdcdc initial; border-style: initial initial solid initial;\" href=\"https://www.bbc.com/news/business-50159963\">the firm reported a rare quarterly profit</a>.</p>\n<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 18px 0px 0px; padding: 0px; vertical-align: baseline;\">Shares rose 4% on Wednesday, making its valuation second only to Toyota.</p>\n<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 18px 0px 0px; padding: 0px; vertical-align: baseline;\">Although Mr Musk\'s company has some way to go to catch up with the Japanese car making giant. Toyota has a stock market valuation of more than $230bn.</p>\n<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 18px 0px 0px; padding: 0px; vertical-align: baseline;\">Some analysts say the rise in price reflects Tesla\'s performance in recent months, during which it has opened a factory in Shanghai and met its production goals.</p>\n<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 18px 0px 0px; padding: 0px; vertical-align: baseline;\">This month, Tesla said it had delivered more than 367,500 cars last year - up 50% from 2018. Investors expect the new factory to act as a springboard that will allow it to capture more of the Chinese market.</p>\n<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 18px 0px 0px; padding: 0px; vertical-align: baseline;\">Despite the increase, Tesla\'s sales remain small compared to those of its competitors.</p>', '5e297aa22641a.jpg', 17, 1, 1, 1, NULL, '2020-01-23 17:51:14', '2020-01-29 16:07:21');
INSERT INTO `articles` (`id`, `user_id`, `title`, `slug`, `body`, `image`, `total_view`, `status`, `is_approved`, `is_active`, `deleted_at`, `created_at`, `updated_at`) VALUES
(2, 8, 'Football: Ronaldo fires Juventus into Italian Cup semi-finals', 'football-ronaldo-fires-juventus-into-italian-cup-semi-finals', '<p style=\"box-sizing: inherit; margin: 0px 0px 25px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: 1.75; font-family: Merriweather, serif; vertical-align: baseline; color: #333333;\">TURIN, Italy:&nbsp;Juventus coach Maurizio Sarri complimented Cristiano Ronaldo\'s mother as the Portuguese star extended his scoring streak in a 3-1 win over Roma to advance to the Italian Cup semi-finals on Wednesday (Jan 22).</p>\n<p style=\"box-sizing: inherit; margin: 0px 0px 25px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: 1.75; font-family: Merriweather, serif; vertical-align: baseline; color: #333333;\">The Portuguese star picked up a Gonzalo Higuain cross after 26 minutes, finishing off from an angle in the Allianz Stadium.</p>', '5e297caa4d2b7.jpg', 0, 1, 0, 1, '2020-01-23 18:36:48', '2020-01-23 17:59:54', '2020-01-23 18:36:48'),
(3, 8, 'NEW ZEALAND TOUR / INDIA WILL PLAY T20 ON 4 GROUNDS', 'new-zealand-tour-india-will-play-t20-on-4-grounds', '<p><span style=\"font-family: \'Open Sans\', sans-serif; font-size: 17px; text-align: justify;\">The first match of the 5 T20 series between&nbsp;</span><span style=\"box-sizing: border-box; font-weight: bold; font-family: \'Open Sans\', sans-serif; font-size: 17px; text-align: justify;\"><a style=\"box-sizing: border-box; color: #004fe6; text-decoration-line: none; background: 0px 0px;\" href=\"https://khulasa-news.com/?s=India+and+New+Zealand\">India and New Zealand</a></span><span style=\"font-family: \'Open Sans\', sans-serif; font-size: 17px; text-align: justify;\">&nbsp;will be held tomorrow. It will be played at Eden Park in Auckland. The second match will take place on 26 January in Auckland, the third on 29 in Hamilton, the fourth on 31 in Wellington and the fifth T20 on 2 February at Mount Mongui (Tauranga).</span></p>\n<h4 style=\"box-sizing: border-box; margin: 0px 0px 16px; font-family: Oswald, sans-serif; font-weight: 550; line-height: 1.1; color: #3d3d3d; font-size: 16px; text-transform: uppercase;\">INDIA&rsquo;S STRENGTH</h4>\n<p style=\"box-sizing: border-box; margin: 0px 0px 16px; text-align: justify; line-height: 24px; font-family: \'Open Sans\', sans-serif; font-size: 17px;\">Currently, only captain Virat Kohli, Rohit Sharma, and Lokesh Rahul are in form in the batting of the Indian team. This is the strength of the team at the moment. As soon as they are out, the middle order is also surrendered. Virat scored 183 runs at an average of 61 in the last 3 ODIs against Australia. At the same time, Rohit scored 171 runs at an average of 57 and Rahul scored 146 runs at an average of 48.66.</p>\n<p style=\"box-sizing: border-box; margin: 0px 0px 16px; line-height: 24px; font-family: \'Open Sans\', sans-serif; font-size: 17px;\">&nbsp;</p>\n<h4 style=\"box-sizing: border-box; margin: 0px 0px 16px; font-family: Oswald, sans-serif; font-weight: 550; line-height: 1.1; color: #3d3d3d; font-size: 16px; text-transform: uppercase;\">INDIA&rsquo;S WEAKNESS</h4>\n<p style=\"box-sizing: border-box; margin: 0px 0px 16px; line-height: 24px; font-family: \'Open Sans\', sans-serif; font-size: 17px;\">Indian spinners have not been able to perform well in the last few series. They are giving more runs and also failed to take wickets. In the last 3 ODIs series against Australia, Ravindra Jadeja and Kuldeep Yadav got a chance in the Indian team. In which both together took only 7 wickets in all three matches. For this, he scored 325 runs in 58 overs.</p>', '5e297df1b7933.jpg', 18, 1, 1, 1, NULL, '2020-01-23 18:05:21', '2020-01-29 13:01:11'),
(4, 9, 'Mahira Khan brings out her funny and quirky side in THIS latest Instagram post', 'mahira-khan-brings-out-her-funny-and-quirky-side-in-this-latest-instagram-post', '<div class=\"coverimg\" style=\"box-sizing: initial; margin: 0px 0px 15px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 10.001px; line-height: inherit; font-family: Roboto, sans-serif; vertical-align: baseline; text-size-adjust: none; position: relative; width: 597.281px; letter-spacing: 0.5px;\">\n<div class=\"coverimgIn\" style=\"box-sizing: initial; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: none; position: relative;\"><img style=\"box-sizing: initial; margin: 0px auto; padding: 0px; border: 0px; font: inherit; vertical-align: bottom; text-size-adjust: none; max-width: 100%; position: absolute; top: 0px; right: 0px; bottom: 0px; left: 0px; object-fit: cover; object-position: center top; height: 442.078px; width: 597.281px; display: block;\" src=\"https://timesofindia.indiatimes.com/thumb/msid-73550515,imgsize-247859,width-800,height-600,resizemode-4/73550515.jpg\" data-imgid=\"73550515\" /><span id=\"alttext-container\" style=\"overflow: hidden; display: inline-block; pointer-events: none; height: 442.078px; width: 597.281px; padding: 1px; box-sizing: border-box; border: 1px solid silver;\"><br class=\"Apple-interchange-newline\" /><img id=\"alttext-image\" style=\"margin: 0px; display: inline; float: left;\" width=\"16\" height=\"16\" align=\"left\" /><span id=\"alttext\"></span></span></div>\n</div>\n<div class=\"as_article clearfix\" style=\"box-sizing: initial; margin: 0px; padding: 0px 0px 15px 22px; border: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 18px; line-height: 26px; font-family: proxima-regular1, Calibri; vertical-align: baseline; text-size-adjust: none; color: #222222; letter-spacing: 0.5px;\">\n<div class=\"article_content clearfix\" style=\"box-sizing: initial; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: none;\">\n<div class=\"section1\" style=\"box-sizing: initial; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: none;\">\n<div class=\"Normal\" style=\"box-sizing: initial; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: none;\">Actress&nbsp;<a class=\"linelink\" style=\"box-sizing: initial; color: #000000; outline: 0px; cursor: pointer; display: inline; font-family: proxima-semibold; opacity: 0.8;\" href=\"https://timesofindia.indiatimes.com/topic/Mahira-Khan\">Mahira Khan</a>&nbsp;became a popular name in India post her appearance with&nbsp;<a class=\"linelink\" style=\"box-sizing: initial; color: #000000; outline: 0px; cursor: pointer; display: inline; font-family: proxima-semibold; opacity: 0.8;\" href=\"https://timesofindia.indiatimes.com/topic/Shah-Rukh-Khan\">Shah Rukh Khan</a>&nbsp;in &lsquo;<a class=\"linelink\" style=\"box-sizing: initial; color: #000000; outline: 0px; cursor: pointer; display: inline; font-family: proxima-semibold; opacity: 0.8;\" href=\"https://timesofindia.indiatimes.com/topic/Raees\">Raees</a>&rsquo;. She also made it to the headlines for her alleged relationship with&nbsp;<a class=\"linelink\" style=\"box-sizing: initial; color: #000000; outline: 0px; cursor: pointer; display: inline; font-family: proxima-semibold; opacity: 0.8;\" href=\"https://timesofindia.indiatimes.com/topic/Ranbir-Kapoor\">Ranbir Kapoor</a>. The pictures of them holidaying together in abroad went viral on the internet a few months back.\n<div class=\"last6brdiv\" style=\"box-sizing: initial; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: none;\">&nbsp;</div>\n<br style=\"box-sizing: initial; content: &quot;&quot;; display: block; text-indent: -100000px; color: #ffffff; height: 15px;\" />Apart from this, Mahira is often seen grabbing the attention through her social media posts. Recently, she posted a picture of herself on&nbsp;<a class=\"linelink\" style=\"box-sizing: initial; color: #000000; outline: 0px; cursor: pointer; display: inline; font-family: proxima-semibold; opacity: 0.8;\" href=\"https://timesofindia.indiatimes.com/topic/Instagram\">Instagram</a>&nbsp;and left all her fans thinking about the post.\n<div class=\"last5brdiv\" style=\"box-sizing: initial; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: none;\">&nbsp;</div>\n<br style=\"box-sizing: initial; content: &quot;&quot;; display: block; text-indent: -100000px; color: #ffffff; height: 15px;\" />\n<div class=\"top2brdiv\" style=\"box-sizing: initial; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: none;\">&nbsp;</div>\n<br style=\"box-sizing: initial; content: &quot;&quot;; display: block; text-indent: -100000px; color: #ffffff; height: 15px;\" />She shared a picture wherein at first glance, it looks like she is lying on the floor. But looking closely at the picture, she can be seen upright but her picture wasn&rsquo;t. It seems she didn&rsquo;t want to adjust or rotate her picture for her followers on Instagram. She even put a hilarious caption for the same. Her post read, &ldquo;Someone suggested adjusting the photo.. bhai hum nahi hotay adjust&rdquo;</div>\n<div class=\"Normal\" style=\"box-sizing: initial; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-size-adjust: none;\">In the picture, she can be seen donning a light blue dress with her hair pulled back in a bun. Soon after her post, a lot of her fans started complimenting the actress. One of the users wrote, &ldquo;Hona bhi mat! You\'re the best the way you are.&rdquo; Another user wrote, &ldquo;Aapko adjust hone ki zarurat bhi nahi hai.&rdquo;</div>\n</div>\n</div>\n</div>', '5e297e6166806.jpg', 24, 1, 1, 1, NULL, '2020-01-23 18:07:13', '2020-01-30 18:49:05'),
(5, 8, 'NEW ZEALAND TOUR / INDIA WILL PLAY T20', 'new-zealand-tour-india-will-play-t20', '<p><span style=\"font-family: \'Open Sans\', sans-serif; font-size: 17px; text-align: justify;\">T<strong>he first match of the 5 T20 series between </strong></span><strong><span style=\"box-sizing: border-box; font-family: \'Open Sans\', sans-serif; font-size: 17px; text-align: justify;\"><a style=\"box-sizing: border-box; color: #004fe6; text-decoration-line: none; background: 0px 0px;\" href=\"https://khulasa-news.com/?s=India+and+New+Zealand\">India and New Zealand</a></span></strong><span style=\"font-family: \'Open Sans\', sans-serif; font-size: 17px; text-align: justify;\"><strong>&nbsp;will be held tomorrow. It will be played at Eden Park in Auckland. The second match will take place on 26 January in Auckland, the third on 29 in Hamilton, the fourth on 31 in Wellington and the fifth T20 on 2 February at Mount Mongui (Tauranga)</strong>.</span></p>\n<p><span style=\"font-family: \'Open Sans\', sans-serif; font-size: 17px; text-align: justify;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"download 3.jpg\" src=\"data:image/jpeg;base64,\" alt=\"\" width=\"300\" height=\"168\" /></span></p>\n<h4 style=\"box-sizing: border-box; margin: 0px 0px 16px; font-family: Oswald, sans-serif; font-weight: 550; line-height: 1.1; color: #3d3d3d; font-size: 16px; text-transform: uppercase;\"><span style=\"color: #000000; font-family: \'Open Sans\', sans-serif; font-size: 17px; text-align: justify; text-transform: none;\">I<strong>ndian opener Shikhar Dhawan got injured right from the New Zealand tour. He suffered a shoulder injury against Australia on 19 January. Sanju Samson was selected in the 16-man squad for the T20 series in place of Dhawan. While Prithvi Shaw has got an opportunity to replace Dhawan for the series of 3 ODIs. The first ODI will be played on 5 February.</strong></span></h4>\n<p style=\"box-sizing: border-box; margin: 0px 0px 16px; line-height: 24px; font-family: \'Open Sans\', sans-serif; font-size: 17px; text-align: center;\">&nbsp;</p>', '5e297fa608c6d.jpg', 20, 1, 1, 1, NULL, '2020-01-23 18:12:38', '2020-01-30 17:04:16'),
(6, 9, 'Bigg Boss 13 Winner', 'bigg-boss-13-winner', '<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: #222222;\">The show started a few weeks ago. There&rsquo;s a long time to decide for the winner. But there are always guesses on few contestants to be the winner. Here&rsquo;s the predicted list of the Bigg Boss 13 winner.</p>\n<p style=\"box-sizing: border-box; font-family: Verdana, Geneva, sans-serif; font-size: 15px; line-height: 26px; margin-top: 0px; margin-bottom: 26px; color: #222222;\"><span style=\"box-sizing: border-box; font-weight: bold;\">The predicted list of Bigg Boss 13 winner is below:<br style=\"box-sizing: border-box;\" /></span></p>\n<ul style=\"box-sizing: border-box; padding: 0px; margin-bottom: 26px; color: #222222; font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">\n<li style=\"box-sizing: border-box; line-height: 26px; margin-left: 21px;\">Sidharth Shukla &ndash; 90%</li>\n<li style=\"box-sizing: border-box; line-height: 26px; margin-left: 21px;\">Asim Riaz &ndash; 85%</li>\n<li style=\"box-sizing: border-box; line-height: 26px; margin-left: 21px;\">Shehnaz Gill &ndash; 85%</li>\n<li style=\"box-sizing: border-box; line-height: 26px; margin-left: 21px;\">\n<h3 style=\"box-sizing: border-box; font-family: Roboto, sans-serif; color: #111111; font-weight: 400; margin: 27px 0px 17px; font-size: 22px; line-height: 30px;\"><span style=\"box-sizing: border-box; font-weight: bold;\">Winning Amount for Bigg Boss Season 13</span></h3>\n<p style=\"box-sizing: border-box; line-height: 26px; margin-top: 0px; margin-bottom: 26px;\">The winning amount was&nbsp;<span style=\"box-sizing: border-box; font-weight: bold;\">Rs. 50 Lakhs</span>&nbsp;for the Bigg Boss Winner.</p>\n</li>\n</ul>', '5e29813ec9d0d.jpg', 20, 1, 1, 1, NULL, '2020-01-23 18:19:26', '2020-01-30 18:31:41');
INSERT INTO `articles` (`id`, `user_id`, `title`, `slug`, `body`, `image`, `total_view`, `status`, `is_approved`, `is_active`, `deleted_at`, `created_at`, `updated_at`) VALUES
(7, 8, 'Prabhu Dheva to direct the next Ek Tha Tiger film for Salman Khan?', 'prabhu-dheva-to-direct-the-next-ek-tha-tiger-film-for-salman-khan', '<p><span style=\"font-family: Roboto, arial; font-size: 16px;\">After his fall-out with&nbsp;</span><a class=\"auto-link\" style=\"box-sizing: inherit; padding: 0px; margin: 0px; outline: 0px; transition: all 0.15s ease-out 0s; color: #ff2b2b; text-decoration-line: none; font-family: Roboto, arial; font-size: 16px;\" title=\"Kabir Khan\" href=\"https://www.bollywoodhungama.com//celebrity/kabir-khan/\" target=\"_blank\" rel=\"noopener\">Kabir Khan</a><span style=\"font-family: Roboto, arial; font-size: 16px;\">&nbsp;and&nbsp;</span><a class=\"auto-link\" style=\"box-sizing: inherit; padding: 0px; margin: 0px; outline: 0px; transition: all 0.15s ease-out 0s; color: #ff2b2b; text-decoration-line: none; font-family: Roboto, arial; font-size: 16px;\" title=\"Ali Abbas Zafar\" href=\"https://www.bollywoodhungama.com//celebrity/ali-abbas-zafar/\" target=\"_blank\" rel=\"noopener\">Ali Abbas Zafar</a><span style=\"font-family: Roboto, arial; font-size: 16px;\">, the&nbsp;</span><em style=\"box-sizing: inherit; padding: 0px; margin: 0px; outline: 0px; font-family: Roboto, arial; font-size: 16px;\">Tiger</em><span style=\"font-family: Roboto, arial; font-size: 16px;\">&nbsp;franchise is rumoured to have fallen into the hands of&nbsp;</span><a class=\"auto-link\" style=\"box-sizing: inherit; padding: 0px; margin: 0px; outline: 0px; transition: all 0.15s ease-out 0s; color: #ff2b2b; text-decoration-line: none; font-family: Roboto, arial; font-size: 16px;\" title=\"Salman Khan\" href=\"https://www.bollywoodhungama.com//celebrity/salman-khan/\" target=\"_blank\" rel=\"noopener\">Salman Khan</a><span style=\"font-family: Roboto, arial; font-size: 16px;\">&rsquo;s current favourite filmmaker Prabhu Dheva. It is to be noted that Prabhu Dheva is doing two back-to-back films with Salman.</span></p>\n<p><span style=\"font-family: Roboto, arial; font-size: 16px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"Street-Dancer-3D-7-346x260.jpg\" src=\"data:image/jpeg;base64,\" alt=\"\" width=\"346\" height=\"260\" /></span></p>\n<p><span style=\"font-family: Roboto, arial; font-size: 16px;\">After&nbsp;</span><em style=\"box-sizing: inherit; padding: 0px; margin: 0px; outline: 0px; font-family: Roboto, arial; font-size: 16px;\"><a class=\"auto-link\" style=\"box-sizing: inherit; padding: 0px; margin: 0px; outline: 0px; transition: all 0.15s ease-out 0s; color: #ff2b2b; text-decoration-line: none;\" title=\"Dabangg 3\" href=\"https://www.bollywoodhungama.com/movie/dabangg-3/\" target=\"_blank\" rel=\"noopener\">Dabangg 3</a></em><span style=\"font-family: Roboto, arial; font-size: 16px;\">&nbsp;they have already moved on to&nbsp;</span><em style=\"box-sizing: inherit; padding: 0px; margin: 0px; outline: 0px; font-family: Roboto, arial; font-size: 16px;\">Radhe</em><span style=\"font-family: Roboto, arial; font-size: 16px;\">&nbsp;which is the unofficial sequel to&nbsp;</span><em style=\"box-sizing: inherit; padding: 0px; margin: 0px; outline: 0px; font-family: Roboto, arial; font-size: 16px;\">Wanted</em><span style=\"font-family: Roboto, arial; font-size: 16px;\">, the film Prabhu Dheva directed for Salman in 2008. We now hear that Salman has offered the next film in the Tiger series after&nbsp;</span><em style=\"box-sizing: inherit; padding: 0px; margin: 0px; outline: 0px; font-family: Roboto, arial; font-size: 16px;\">Ek Tha Tiger</em><span style=\"font-family: Roboto, arial; font-size: 16px;\">&nbsp;and&nbsp;</span><em style=\"box-sizing: inherit; padding: 0px; margin: 0px; outline: 0px; font-family: Roboto, arial; font-size: 16px;\"><a class=\"auto-link\" style=\"box-sizing: inherit; padding: 0px; margin: 0px; outline: 0px; transition: all 0.15s ease-out 0s; color: #ff2b2b; text-decoration-line: none;\" title=\"Tiger Zinda Hai\" href=\"https://www.bollywoodhungama.com//movie/tiger-zinda-hai/\" target=\"_blank\" rel=\"noopener\">Tiger Zinda Hai</a></em><span style=\"font-family: Roboto, arial; font-size: 16px;\">&nbsp;to Prabhu Dheva.</span></p>', '5e2983359511a.jpg', 21, 1, 1, 1, NULL, '2020-01-23 18:27:49', '2020-01-29 10:42:31');
INSERT INTO `articles` (`id`, `user_id`, `title`, `slug`, `body`, `image`, `total_view`, `status`, `is_approved`, `is_active`, `deleted_at`, `created_at`, `updated_at`) VALUES
(8, 1, 'Shah Rukh Khan makes a special appearance on Dance Plus 5', 'shah-rukh-khan-makes-a-special-appearance-on-dance-plus-5', '<p><span style=\"font-family: Roboto, sans-serif; font-size: 14px;\">Shah Rukh Khan recently descended on the sets of Star Plus\' dance reality show Dance Plus 5.</span><span style=\"font-family: Roboto, sans-serif; font-size: 14px;\">The Raees actor sported a white attire as he came on the show as a special judge.</span><span style=\"font-family: Roboto, sans-serif; font-size: 14px;\">While many had hoped that King Khan would announce his next film on his birthday, November 2, Shah Rukh Khan is still keeping his fans waiting.</span></p>\r\n<p><span style=\"font-family: Roboto, sans-serif; font-size: 14px;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"srk-3 new.webp\" src=\"data:image/webp;base64,\" alt=\"\" width=\"536\" height=\"804\" /></span></p>\r\n<p><span style=\"font-family: Roboto, sans-serif; font-size: 14px;\">The special episode featuring SRK will be braodcast on Republic Day. The Dance Plus 5 contestants also prepared a special performance showcasing Shah Rukh\'s journey in Bollywood</span></p>', '5e2ead4a656f1.jpg', 33, 1, 1, 1, NULL, '2020-01-23 18:55:27', '2020-01-30 18:24:29');
INSERT INTO `articles` (`id`, `user_id`, `title`, `slug`, `body`, `image`, `total_view`, `status`, `is_approved`, `is_active`, `deleted_at`, `created_at`, `updated_at`) VALUES
(9, 1, 'IMRAN KHAN MAKES A MELODY OF KASHMIR, TRUMP AGAIN WISHES FOR HELP', 'imran-khan-makes-a-melody-of-kashmir-trump-again-wishes-for-help', '<p><span style=\"font-family: \'Open Sans\', sans-serif; font-size: 17px; text-align: justify;\">US President Donald Trump met Pakistan Prime Minister <strong>Imran Khan.</strong></span><span style=\"font-family: \'Open Sans\', sans-serif; font-size: 17px; text-align: justify;\"> The two met on the sidelines of the World Economic Forum Summit that began on Tuesday in Davos, Switzerland.</span></p>\r\n<p><span style=\"font-family: \'Open Sans\', sans-serif; font-size: 17px; text-align: justify;\">Trump said during the meeting, &ldquo;We talked about the Kashmir issue. If we can help with what is going on in this relationship between India and Pakistan, we will definitely do it. We are watching this issue closely. &rdquo;</span></p>', '5e298be5b565a.jpg', 23, 1, 1, 1, NULL, '2020-01-23 19:04:53', '2020-01-30 18:24:05');
INSERT INTO `articles` (`id`, `user_id`, `title`, `slug`, `body`, `image`, `total_view`, `status`, `is_approved`, `is_active`, `deleted_at`, `created_at`, `updated_at`) VALUES
(10, 1, 'Valentine Week List 2020', 'valentine-week-list-2020', '<p><span style=\"font-family: Merriweather, serif; font-size: 18px; background-color: rgba(255, 255, 255, 0.9);\"><em><strong>The Loveliest week of the year, the Valentine&rsquo;s week or Love Week! The week starts from 7th of February and ends oh 14th of February. The love week starts with the Rose Day followed by Propose Day, Chocolate Day, Teddy Day, Promise Day, Hug Day, Kiss Day and finishes with the Happy Valentine day</strong></em></span></p>\n<p>&nbsp;</p>\n<p><span style=\"font-family: Merriweather, serif; font-size: 18px; background-color: rgba(255, 255, 255, 0.9);\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"7169bnhy-gL.jpg\" src=\"data:image/jpeg;base64,\" alt=\"\" width=\"534\" height=\"300\" /><br /></span></p>\n<p>&nbsp;</p>\n<table style=\"box-sizing: border-box; margin: 0px 0px 1.25rem; padding: 0px; outline: 0px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 1px solid #dddddd; table-layout: auto; width: 1003px; color: #222222; font-family: Roboto, Arial, sans-serif; font-size: 14px;\">\n<tbody style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px;\">\n<tr style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px;\">\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 102px;\">Date</td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 98px;\">Valentine Week List</td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 96px;\">Day</td>\n</tr>\n<tr style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; background: #f9f9f9;\">\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 102px;\">7th Feb</td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 98px;\"><a style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; color: #31afac; line-height: inherit; text-decoration-line: none;\" href=\"https://www.fnp.com/article/when-is-rose-day\">Rose Day</a></td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 96px;\">Friday</td>\n</tr>\n<tr style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px;\">\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 102px;\">8th Feb</td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 98px;\"><a style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; color: #31afac; line-height: inherit; text-decoration-line: none;\" href=\"https://www.fnp.com/article/when-is-propose-day\">Propose Day</a></td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 96px;\">Saturday</td>\n</tr>\n<tr style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; background: #f9f9f9;\">\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 102px;\">9th Feb</td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 98px;\"><a style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; color: #31afac; line-height: inherit; text-decoration-line: none;\" href=\"https://www.fnp.com/article/when-is-chocolate-day\">Chocolates Day</a></td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 96px;\">Sunday</td>\n</tr>\n<tr style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px;\">\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 102px;\">10th Feb</td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 98px;\"><a style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; color: #31afac; line-height: inherit; text-decoration-line: none;\" href=\"https://www.fnp.com/article/when-is-teddy-day\">Teddy Day</a></td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 96px;\">Monday</td>\n</tr>\n<tr style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; background: #f9f9f9;\">\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 102px;\">11th Feb</td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 98px;\"><a style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; color: #31afac; line-height: inherit; text-decoration-line: none;\" href=\"https://www.fnp.com/article/when-is-promise-day\">Promise Day</a></td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 96px;\">Tuesday</td>\n</tr>\n<tr style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px;\">\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 102px;\">12th Feb</td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 98px;\"><a style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; color: #31afac; line-height: inherit; text-decoration-line: none;\" href=\"https://www.fnp.com/article/when-is-hug-day\">Hug Day</a></td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 96px;\">Wednesday</td>\n</tr>\n<tr style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; background: #f9f9f9;\">\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 102px;\">13th Feb</td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 98px;\"><a style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px; color: #31afac; line-height: inherit; text-decoration-line: none;\" href=\"https://www.fnp.com/article/when-is-kiss-day\">Kiss Day</a></td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 96px;\">Thursday</td>\n</tr>\n<tr style=\"box-sizing: border-box; margin: 0px; padding: 0px; outline: 0px;\">\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 102px;\">14th Feb</td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 98px;\">Valentine Day</td>\n<td style=\"box-sizing: border-box; margin: 0px; padding: 0.5625rem 0.625rem; outline: 0px; line-height: 1.125rem; font-size: 0.875rem; width: 96px;\">Friday</td>\n</tr>\n</tbody>\n</table>\n<p>A day without you is a day without sun, a night without you is a night without moon; a life without you is a life without life.</p>\n<p>May You Be Bestowed With Knowledge And Wisdom. Have A Blessed Vasant Panchami!</p>\n<p>There\'s nothing better than spending this day with the person I care about the most. Happy Valentine\'s Day!!</p>', '5e298e552e829.png', 30, 1, 1, 1, NULL, '2020-01-23 19:09:51', '2020-01-30 18:22:57');
INSERT INTO `articles` (`id`, `user_id`, `title`, `slug`, `body`, `image`, `total_view`, `status`, `is_approved`, `is_active`, `deleted_at`, `created_at`, `updated_at`) VALUES
(11, 2, 'India vs New Zealand, 1st T20I Live Score: Bumrah, Chahal strike to pull things back', 'india-vs-new-zealand-1st-t20i-live-score-bumrah-chahal-strike-to-pull-things-back', '<h2 id=\"shortdiscription2\" class=\"short-discription\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; list-style: none; font-weight: 300; font-family: OpenSans-Regular; overflow-wrap: break-word; font-size: 17px; line-height: 24px; color: #111111;\">India (IND) vs New Zealand (NZ) 1st T20, Live Cricket Score: Kane Williamson has departed for a 26-ball 51 after stitching a 50-plus stand with Ross Taylor who is hitting it big and clean at the Eden Park. New Zealand are looking fora 200-plus score. India\'s fielding has been shoddy today. Can the visitors pull it back in the final few overs?</h2>\n<p>&nbsp;</p>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"EPBqgUvUwAEDV15.jpg\" src=\"data:image/jpeg;base64,\" alt=\"\" width=\"680\" height=\"383\" /></p>\n<p>&nbsp;</p>\n<div class=\"blog-multi-title\" style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; list-style: none; font-size: 25px; font-family: Merriweather-Bold; line-height: 34px; color: #262626;\">WICKET! Williamson falls after 10th T20I fifty</div>\n<div class=\"blog-multi-desc\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; list-style: none; color: #111111; font-family: OpenSans-Regular; font-size: 15px;\">\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; list-style: none; overflow-wrap: break-word; font-size: 17px; line-height: 24px;\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; list-style: none;\">FIFTY and GONE!</strong>&nbsp;Kane Williamson has been outfoxed! Yuzvendra Chahal floats it wide and the New Zealand captain gets a top edge. Virat Kohli with an easy catch.</p>\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; list-style: none; overflow-wrap: break-word; font-size: 17px; line-height: 24px;\">Williamson though has done the job for New Zealand. A 26-ball 51 to set up a fine platform for the middle-order to go big. He had hit Chahal for 3 brilliant boundaries before getting out in the over.</p>\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; list-style: none; overflow-wrap: break-word; font-size: 17px; line-height: 24px;\">&nbsp;</p>\n<div class=\"blog-multi-title\" style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; list-style: none; font-size: 25px; font-family: Merriweather-Bold; line-height: 34px; color: #262626;\">IND vs NZ: 22 runs in Shami\'s 3rd over</div>\n<div class=\"blog-multi-desc\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; list-style: none;\">\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; list-style: none; overflow-wrap: break-word; font-size: 17px; line-height: 24px;\">Okay, Ross Taylor is in the mood now. He took apart Mohammed Shami in the India pacer\'s 3rd over. 22 runs from it. 2 massive sixes in it. New Zealand are eyeing a mammoth total here. Excellent batting from Taylor and Kane Williamson. How many will the hosts finish with?</p>\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; list-style: none; overflow-wrap: break-word; font-size: 17px; line-height: 24px;\">&nbsp;</p>\n<div class=\"blog-multi-title\" style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; list-style: none; font-size: 25px; font-family: Merriweather-Bold; line-height: 34px; color: #262626;\">1st T20I: Taylor, Williamson put pressure back on India</div>\n<div class=\"blog-multi-desc\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; list-style: none;\">\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; list-style: none; overflow-wrap: break-word; font-size: 17px; line-height: 24px;\">Ross Taylor has found his rhythm. He took his time to get going but has taken the attack to Yuzvendra Chahal. The India leg-spinner leaks 13 runs in his 3rd over. New Zealand are once again in a dominant position after the quick wickets of Colin Munro and Colin de Grandhomme.</p>\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; list-style: none; overflow-wrap: break-word; font-size: 17px; line-height: 24px;\">Taylor and Williamson have realised that they need to keep getting the big ones to post a daunting total. They are doing it well at the moment.&nbsp;<strong style=\"box-sizing: border-box; margin: 0px; padding: 0px; list-style: none;\">Pressure back on India!</strong></p>\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; list-style: none; overflow-wrap: break-word; font-size: 17px; line-height: 24px;\">&nbsp;</p>\n<div class=\"blog-multi-title\" style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; list-style: none; font-size: 25px; font-family: Merriweather-Bold; line-height: 34px; color: #262626;\">SIX! Kohli not impressed with Chahal\'s effort</div>\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; list-style: none; overflow-wrap: break-word; font-size: 17px; line-height: 24px;\">&nbsp;</p>\n<div class=\"blog-multi-desc\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; list-style: none;\">\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; list-style: none; overflow-wrap: break-word; font-size: 17px; line-height: 24px;\">SIX! Shivam Dube should have had his 2nd wicket there. Kane Williamson picked up a short ball from Dube and hit it straight towards the deep mid-wicket fielder. It was Yuzvendra Chahal but the ball flies over his head. He was standing well in front of the boundary ropes. Regulation catch if he had been stationed at the boundary.</p>\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 0px 10px; list-style: none; overflow-wrap: break-word; font-size: 17px; line-height: 24px;\">Virat Kohli is not impressed with that effort. So is Shivam Dube.</p>\n</div>\n</div>\n</div>\n</div>', '5e2aa9be41fbc.jpeg', 20, 1, 1, 1, NULL, '2020-01-24 15:24:30', '2020-01-30 18:22:56');
INSERT INTO `articles` (`id`, `user_id`, `title`, `slug`, `body`, `image`, `total_view`, `status`, `is_approved`, `is_active`, `deleted_at`, `created_at`, `updated_at`) VALUES
(12, 1, 'Ayodhya dispute: SC observation akin to Liberhan Commission finding on demolition', 'ayodhya-dispute-sc-observation-akin-to-liberhan-commission-finding-on-demolition', '<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\">Though there are few lines in the judgement on the demolition of mosque, the observation was reminiscent of the inquiry commission headed by Justice M S Liberhan, set up by the then PV Narasimha Rao govt within 10 days of the demolition in 1992, which also had given the finding that entire demolition was carried out in an \"orchestrated\" manner.</span></p>\n<p>&nbsp;</p>\n<p><span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 13px;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"news.webp\" src=\"data:image/webp;base64,\" alt=\"\" width=\"436\" height=\"280\" /></span></p>\n<p><span style=\"font-family: Arial; font-size: 12px;\">NEW DELHI: The Supreme Court, which kept itself away during the Ayodhya land dispute case hearings from going into the issue of demolition of the disputed structure on December 6, 1992, made a passing remark in its judgement on Saturday about the event saying it was brought down in a \"calculated act.\"</span><br style=\"background: transparent; font-size: 12px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; font-family: Arial;\" /><br style=\"background: transparent; font-size: 12px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; font-family: Arial;\" /><span style=\"font-family: Arial; font-size: 12px;\">The apex court noted that during the pendency of the lawsuits on the disputed land, \"the entire structure of the mosque was brought down in a calculated act of destroying a place of public .</span><span style=\"font-family: Arial; font-size: 12px;\">He submitted the report in June 2009, during the tenure of Manmohan Singh as the prime minister.</span></p>\n<p><br style=\"background: transparent; font-size: 12px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; font-family: Arial;\" /><span style=\"font-family: Arial; font-size: 12px;\">After examining the deposition of top leadership of the time including former prime ministers P V Narasimha Rao and V P Singh, BJP patriarch L K Advani, Murli Manohar Joshi, Kalyan Singh, former Uttar Pradesh Chief Minister and other leading lights of the Mandir movement, the Liberhan Commission in its report held the then top leadership of BJP and Sangh Parivar (RSS, VHP and Bajrang Dal) cu&nbsp;..</span></p>\n<p>&nbsp;</p>', '5e2aaee6e21b5.jpg', 33, 1, 1, 1, NULL, '2020-01-24 15:46:31', '2020-01-30 18:31:35');
