(13, 16, 'Memorial benches: \'A quiet reminder of people gone, but not forgotten\'', 'memorial-benches-a-quiet-reminder-of-people-gone-but-not-forgotten', '<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 18px 165.16px 0px; padding: 0px; vertical-align: baseline; text-align: left;\"><strong style=\"border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-family: inherit; font-size: 1rem; letter-spacing: inherit; line-height: 1.375; margin: 0px; padding: 0px; vertical-align: baseline;\">Veterans, friends and family come to sit on a bench in Bognor Regis to pause, reflect and remember serviceman Danny Johnston</strong></p>\n<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 18px 165.16px 0px; padding: 0px; vertical-align: baseline; text-align: left;\"><strong style=\"border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-family: inherit; font-size: 1rem; letter-spacing: inherit; line-height: 1.375; margin: 0px; padding: 0px; vertical-align: baseline;\"><img style=\"float: left;\" title=\"test.jpg\" src=\"data:image/jpeg;base64,\" alt=\"\" width=\"629\" height=\"353\" /></strong></p>\n<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 18px 165.16px 0px; padding: 0px; vertical-align: baseline; text-align: left;\">&nbsp;</p>\n<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 18px 165.16px 0px; padding: 0px; vertical-align: baseline; text-align: left;\">&nbsp;</p>\n<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 18px 165.16px 0px; padding: 0px; vertical-align: baseline; text-align: left;\">&nbsp;</p>\n<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 18px 165.16px 0px; padding: 0px; vertical-align: baseline; text-align: left;\">&nbsp;</p>\n<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 18px 165.16px 0px; padding: 0px; vertical-align: baseline; text-align: left;\">A simple plaque tells of his premature death, at the age of just 35.</p>\n<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 18px 165.16px 0px; padding: 0px; vertical-align: baseline; text-align: left;\">The rest of the Hotham Park seat is far from simple. Unique carvings remind them of Danny\'s service - for the Princess of Wales\'s Royal Regiment and the Special Reconnaissance Regiment - and of his love for the music of The Rolling Stones and The Who.</p>\n<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 18px 165.16px 0px; padding: 0px; vertical-align: baseline; text-align: left;\">\"We get comfort from it being here. Knowing he is not forgotten means so much to me,\" says his grieving mum Viv Johnston.</p>\n<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 18px 165.16px 0px; padding: 0px; vertical-align: baseline; text-align: left;\">\"I hope this bench will be here for a long time after I am, and I hope that people will remember Danny, because he was a truly marvellous person.\"</p>\n<p style=\"border: 0px; color: #404040; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Helmet, Freesans, Helvetica, Arial, sans-serif; font-size: 1rem; line-height: 1.375; margin: 18px 165.16px 0px; padding: 0px; vertical-align: baseline; text-align: left;\">&nbsp;</p>', '5e2ec332731a2.jpg', 12, 1, 1, 1, NULL, '2020-01-27 18:02:10', '2020-01-30 18:22:54');
INSERT INTO `articles` (`id`, `user_id`, `title`, `slug`, `body`, `image`, `total_view`, `status`, `is_approved`, `is_active`, `deleted_at`, `created_at`, `updated_at`) VALUES
(14, 1, 'India New Zealand | India Thrash New Zealand in Second T20I, Take 2-0 Series Lead', 'india-new-zealand-india-thrash-new-zealand-in-second-t20i-take-2-0-series-lead', '<p>India tightened their grip on the T20I series with a seven-wicket drubbing of New Zealand in the second match after their bowlers stifled the hosts in Auckland on Sunday.</p>\r\n<p>Chasing 133 proved to be a cakewalk for the visitors on a pitch that was slightly on the slower side, but the short boundaries ensured the match ended with 15 balls to spare.</p>\r\n<p>The trio of Ravindra Jadeja, Jasprit Bumrah and Mohammed Shami allowed no respite to Kane Williamson\'s team after New Zealand surprisingly chose to bat, restricting them to 132-5.</p>\r\n<p>&nbsp;</p>\r\n<p>KL Rahul then scored 57 not out off 50 balls while Shreyas Iyer scored 44 off 33 balls, the duo adding 86 runs for the third wicket and after Rohit Sharma\'s twin failure.</p>\r\n<p>Tim Southee took 2-20 as India had to do without major contributions from both Sharma and skipper Virat Kohli.</p>\r\n<p>Rohit (8) was out caught at slip in the first over off Southee. New Zealand\'s new ball bowlers were compact and didn\'t let the Indian top order get away unlike in the first T20I.</p>\r\n<p>Rahul and Kohli then added 31 runs for the second wicket. The latter then was caught behind off Southee in the sixth over with Tim Seifert taking a brilliant diving catch.</p>\r\n<p>Kohli scored 11 off 12 balls and the wicket\'s slow nature was starting to impact proceedings. New Zealand held back their spinners too, but Rahul and Iyer settled down in this passage of play.</p>\r\n<p>They rotated strike well and added 50 in 55 balls by minimising risks. Rahul brought up his 11th T20I half-century off 43 balls.</p>\r\n<p>Overall, Rahul hit three fours and two sixes, while Iyer hit one four and three sixes.</p>\r\n<p>India crossed 100 in the 15th over after which Iyer cut loose to approach the finish line. He fell just prior, holing out off Ish Sodhi (1-33).</p>\r\n<p>But Rahul stuck around while Shivam Dube finished the job with a six over midwicket.</p>\r\n<p>This was after Indian bowlers made good use of a slower pitch.</p>\r\n<p>Opting to bat, the Black Caps couldn\'t generate enough momentum in the middle overs and finished with a sub-par total.</p>\r\n<p>Martin Guptill top-scored with 33 off 20 balls, while Tim Seifert was unbeaten on 33 not out off 26 balls.</p>\r\n<p>Guptill and Colin Munro (26) provided a measured start to New Zealand putting on 48 runs for the first wicket.</p>\r\n<p>Surprisingly, India held back Jasprit Bumrah (1-21) as Shardul Thakur (1-21) and Mohammed Shami (0-22) bowled four overs in the power play. The tactic worked as Thakur got rid of Guptill at end of six overs.</p>\r\n<p>India then used the slow nature of the used-wicket to put brakes on the New Zealand middle order. Wickets came at a regular interval as the Black Caps struggled to get the big shots out.</p>\r\n<p>Yuzvendra Chahal (0-33) and Shivam Dube (1-16) combined well after the powerplay, while Ravindra Jadeja was the stand out bowler with figures of 2-18 from four overs.</p>\r\n<p>Overall, India also raised their fielding effort barring a bizarre drop from Virat Kohli late in the innings.</p>\r\n<p>Dube got rid of Munro in the ninth over while Colin de Grandhomme (3) failed to get going once again. Jadeja gleefully accepted his return catch.</p>\r\n<p>The hosts were reduced to 81 for four in the 13th over when skipper Kane Williamson (14) became Jadeja\'s victim, caught in the deep by Chahal.</p>\r\n<p>The wheels had truly come off the New Zealand innings as they were struggling to get the big shots away and squandered their measured start away.</p>\r\n<p>Ross Taylor (18) struggling for timing throughout his 24-ball stay was a prime example. Without Seifert\'s effort, including a four and two sixes, the score wouldn\'t have achieved any respectability.</p>', '5e2ec7e4cc7c9.jpg', 14, 1, 1, 1, NULL, '2020-01-27 18:22:15', '2020-01-30 18:22:51');
INSERT INTO `articles` (`id`, `user_id`, `title`, `slug`, `body`, `image`, `total_view`, `status`, `is_approved`, `is_active`, `deleted_at`, `created_at`, `updated_at`) VALUES
(15, 16, 'Wahiyat Wednesday: Jab Harry Met Sejal, Imtiaz Ali made your face meet palm', 'wahiyat-wednesday-jab-harry-met-sejal-imtiaz-ali-made-your-face-meet-palm', '<h2 style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-weight: 500; font-family: Opensans-Regular; overflow-wrap: break-word; color: #111111; font-size: 18px; line-height: 26px; font-style: italic;\">What could have been the ultimate romantic film, turned out to so utterly disappointing. Why, Imtiaz Ali, why?</h2>\n<p><span style=\"font-family: OpenSans-Regular; font-size: 17px;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"katrina-cobie_1579783994__rend_16_9.jpg\" src=\"data:image/jpeg;base64,\" alt=\"\" width=\"600\" height=\"337\" /></span></p>\n<p><span style=\"font-family: OpenSans-Regular; font-size: 17px;\">mtiaz Ali\'s&nbsp;</span><a style=\"box-sizing: border-box; margin: 0px; padding: 0px; text-decoration-line: none; color: #026bc5; font-size: 17px; vertical-align: baseline; background: transparent; font-family: OpenSans-Regular;\" href=\"https://www.indiatoday.in/movies/bollywood/story/love-aaj-kal-trailer-out-kartik-aaryan-and-sara-ali-khan-add-nothing-new-in-rehashed-imtiaz-ali-film-1637730-2020-01-17\" target=\"_blank\" rel=\"noopener\"><u style=\"box-sizing: border-box; margin: 0px; padding: 0px;\"><strong style=\"box-sizing: border-box; margin: 0px; padding: 0px;\">Love Aaj Kal trailer</strong></u></a><span style=\"font-family: OpenSans-Regular; font-size: 17px;\">, which hit the internet recently, had many in doubt. While some of us tried to defend it by listing some of his timeless films like Highway, Tamasha, Jab We Met; one sentence was enough to shut us down - \"But he is also the director who made Jab Harry Met </span><span style=\"font-family: OpenSans-Regular; font-size: 17px;\">Sejal.\"</span></p>\n<p style=\"box-sizing: border-box; margin: 0px; padding: 10px 0px; overflow-wrap: break-word; font-family: OpenSans-Regular; font-size: 17px;\">Before Jab Harry Met Sejal, Imtiaz had already fed us with his brand of films, loaded with complex characters like that of Ved, Veronica, Veera, Veer and more. So, when he came to the big screen with the Rab Ne Bana Di Jodi of Anushka Sharma and Shah Rukh Khan, it was hard not to walk into the theatre without biases.</p>\n<p style=\"box-sizing: border-box; margin: 0px; padding: 10px 0px; overflow-wrap: break-word; font-family: OpenSans-Regular; font-size: 17px;\">Jab Harry Met Sejal (2017) was a collaboration between a director who redefined rom-coms in the Hindi film industry with the King of Romance. It was deemed to be a classic, the ultimate romantic film boiling and brimming in emotions the Indian audience didn\'t know they were capable of feeling. Sadly, it turned out to be the weakest film of Imitiaz\'s career and a grand waste of Shah Rukh\'s talent.</p>\n<h2 style=\"box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-weight: 500; font-family: Opensans-Regular; overflow-wrap: break-word; color: #111111; font-size: 18px; line-height: 26px; font-style: italic;\">Kajol revealed details of her life with husband Ajay Devgn. The two will be seen together in Tanhaji: The Unsung Warrior.</h2>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" title=\"fgfg-770x433.webp\" src=\"data:image/webp;base64,\" alt=\"\" width=\"770\" height=\"433\" /></p>\n<p style=\"box-sizing: border-box; margin: 0px; padding: 10px 0px; overflow-wrap: break-word; font-family: OpenSans-Regular; font-size: 17px;\">ajol and Ajay Devgn have a great history on and off the screen. The couple has been married for 21 years. Kajol recently opened up on her life with husband Ajay in an interaction with Humans Of Bombay.</p>\n<p style=\"box-sizing: border-box; margin: 0px; padding: 10px 0px; overflow-wrap: break-word; font-family: OpenSans-Regular; font-size: 17px;\">From meeting for the first time on the sets of Hulchul to dating and eventually marrying each other, Kajol told the story of their life in an emotional post. She also mentioned the difficult times they faced together.</p>\n<p style=\"box-sizing: border-box; margin: 0px; padding: 10px 0px; overflow-wrap: break-word; font-family: OpenSans-Regular; font-size: 17px;\">She wrote, \"We met 25 years ago, on the sets of HulchulI was ready for the shot &amp; asked, Where&rsquo;s my hero?&rsquo; Someone pointed him outhe was broodily sitting in a corner. So 10 minutes before I met him, I bitched about him! We began talking on set &amp; became friends. I was dating someone at the time &amp; so was heI&rsquo;ve even complained about my then boyfriend to him! Soon, we both broke up with our significant others. Neither of us proposedit was understood that we were to be together. It went from hand-holding to a lot more before we knew it!\"</p>\n<p style=\"box-sizing: border-box; margin: 0px; padding: 10px 0px; overflow-wrap: break-word; font-family: OpenSans-Regular; font-size: 17px;\">She mentioned that her dad didn\'t approve of their marriage at first, \"We&rsquo;d been dating for 4 years, when we decided to get married. His parents were on board, but my dad didn&rsquo;t talk to me for 4 days. He wanted me to focus on my career, but I was firm &amp; he eventually came around,\" she said.</p>', '5e2ff3a414d6f.webp', 13, 1, 1, 1, NULL, '2020-01-28 15:41:09', '2020-01-30 18:22:50');
INSERT INTO `articles` (`id`, `user_id`, `title`, `slug`, `body`, `image`, `total_view`, `status`, `is_approved`, `is_active`, `deleted_at`, `created_at`, `updated_at`) VALUES
(16, 16, 'India tied with New Zealand (India win Super Over by 2 wickets)', 'india-tied-with-new-zealand-india-win-super-over-by-2-wickets', '<p>India tied with New Zealand (India win Super Over by 2 wickets)</p>\n<p>The ghost of the Super Over came back to haunt New Zealand again as they wilted under pressure from a couple of winning positions to hand India the series on Wednesday (January 29).</p>\n<p>&nbsp;</p>\n<p>The hosts had things in control in their chase of 180 thanks to a sensational masterclass on a slow Hamilton pitch from captain Kane Williamson, whose sublime 95 off 48 balls left them right on the brink of victory. However, Mohammed Shami produced a stunning final over, giving away just one run off the final four balls to take the game into a tie-breaker.</p>\n<pre class=\"lang-js prettyprint prettyprinted\" style=\"margin-top: 0px; margin-bottom: 1em; padding: 12px 8px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Consolas, Menlo, Monaco, \'Lucida Console\', \'Liberation Mono\', \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Courier New\', monospace, sans-serif; font-size: 13px; vertical-align: baseline; box-sizing: inherit; width: auto; max-height: 600px; overflow: auto; background-color: #eff0f1; border-radius: 3px; color: #393318; overflow-wrap: normal;\"><code style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: Consolas, Menlo, Monaco, \'Lucida Console\', \'Liberation Mono\', \'DejaVu Sans Mono\', \'Bitstream Vera Sans Mono\', \'Courier New\', monospace, sans-serif; vertical-align: baseline; box-sizing: inherit; white-space: inherit;\"><span class=\"pun\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #303336;\">&lt;</span><span class=\"pln\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #303336;\">iframe width</span><span class=\"pun\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #303336;\">=</span><span class=\"str\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #7d2727;\">\"560\"</span><span class=\"pln\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #303336;\"> height</span><span class=\"pun\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #303336;\">=</span><span class=\"str\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #7d2727;\">\"315\"</span><span class=\"pln\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #303336;\"> src</span><span class=\"pun\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #303336;\">=</span><span class=\"str\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #7d2727;\">\"https://www.youtube.com/embed/LIMYj5mpMM4\"</span><span class=\"pln\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #303336;\"> frameborder</span><span class=\"pun\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #303336;\">=</span><span class=\"str\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #7d2727;\">\"0\"</span><span class=\"pln\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #303336;\"> gesture</span><span class=\"pun\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #303336;\">=</span><span class=\"str\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #7d2727;\">\"media\"</span><span class=\"pln\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #303336;\"> allow</span><span class=\"pun\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #303336;\">=</span><span class=\"str\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #7d2727;\">\"encrypted-media\"</span><span class=\"pln\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #303336;\"> allowfullscreen</span><span class=\"pun\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #303336;\">&gt;&lt;/</span><span class=\"pln\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #303336;\">iframe</span><span class=\"pun\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: #303336;\">&gt;</span></code></pre>\n<p>Even there, New Zealand had the guiding hand of Williamson as the hosts were primed to get third time lucky on their Super Over record. Tim Southee got 17 runs to defend, and started well in his pursuit. But with 10 needed off two balls, he missed his lengths by significant margins and Rohit Sharma - the standout batsman for India - monstered a couple of sixes into the stands to seal New Zealand\'s fate and the series.</p>', '5e3168a1e0bd2.jpg', 0, 1, 0, 1, NULL, '2020-01-29 18:12:34', '2020-01-29 18:40:10'),
(17, 1, 'The Difference Between Fall Lovers And Fall Haters, In One Funny Video', 'the-difference-between-fall-lovers-and-fall-haters-in-one-funny-video', '<p style=\"list-style: none; margin: 0px 0px 20px; padding: 0px; border: 0px; box-sizing: inherit; font-size: 1.125rem; line-height: 1.75rem; font-family: ProximaNova, \'Noto Sans KR\', \'Helvetica Neue\', Helvetica, Roboto, Arial, \'ヒラギノ角ゴ Pro W3\', \'Hiragino Kaku Gothic Pro\', Osaka, メイリオ, Meiryo, \'ＭＳ Ｐゴシック\', \'MS PGothic\', sans-serif;\">Fall is in full swing, which means colorful foliage, apple-picking Instagram posts and&nbsp;<a style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; box-sizing: inherit; color: #000000; text-decoration-line: none; box-shadow: #0dbe98 0px -2px 0px inset; transition: box-shadow 0.3s ease-out 0s, background-color 0.3s ease-out 0s;\" href=\"https://www.huffpost.com/entry/pumpkin-spice_l_5d8236f7e4b0957256af5b8e\" target=\"_blank\" rel=\"noopener noreferrer\" data-rapid-elm=\"context_link\" data-ylk=\"elm:context_link\" data-rapid-sec=\"{&quot;entry-text&quot;:&quot;entry-text&quot;}\" data-rapid_p=\"1\" data-v9y=\"1\">pumpkin spice-flavored everything</a>.</p>\r\n<p style=\"list-style: none; margin: 0px 0px 20px; padding: 0px; border: 0px; box-sizing: inherit; font-size: 1.125rem; line-height: 1.75rem; font-family: ProximaNova, \'Noto Sans KR\', \'Helvetica Neue\', Helvetica, Roboto, Arial, \'ヒラギノ角ゴ Pro W3\', \'Hiragino Kaku Gothic Pro\', Osaka, メイリオ, Meiryo, \'ＭＳ Ｐゴシック\', \'MS PGothic\', sans-serif;\"><iframe src=\"//www.youtube.com/embed/9dcmoGOn188\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p style=\"list-style: none; margin: 0px 0px 20px; padding: 0px; border: 0px; box-sizing: inherit; font-size: 1.125rem; line-height: 1.75rem; font-family: ProximaNova, \'Noto Sans KR\', \'Helvetica Neue\', Helvetica, Roboto, Arial, \'ヒラギノ角ゴ Pro W3\', \'Hiragino Kaku Gothic Pro\', Osaka, メイリオ, Meiryo, \'ＭＳ Ｐゴシック\', \'MS PGothic\', sans-serif;\">&nbsp;</p>\r\n<p style=\"list-style: none; margin: 0px 0px 20px; padding: 0px; border: 0px; box-sizing: inherit; font-size: 1.125rem; line-height: 1.75rem; font-family: ProximaNova, \'Noto Sans KR\', \'Helvetica Neue\', Helvetica, Roboto, Arial, \'ヒラギノ角ゴ Pro W3\', \'Hiragino Kaku Gothic Pro\', Osaka, メイリオ, Meiryo, \'ＭＳ Ｐゴシック\', \'MS PGothic\', sans-serif;\">For many, this is a joyous time, but for others, it&rsquo;s just a period of mourning the end of sweet, sweet summertime.</p>\r\n<p style=\"list-style: none; margin: 0px 0px 20px; padding: 0px; border: 0px; box-sizing: inherit; font-size: 1.125rem; line-height: 1.75rem; font-family: ProximaNova, \'Noto Sans KR\', \'Helvetica Neue\', Helvetica, Roboto, Arial, \'ヒラギノ角ゴ Pro W3\', \'Hiragino Kaku Gothic Pro\', Osaka, メイリオ, Meiryo, \'ＭＳ Ｐゴシック\', \'MS PGothic\', sans-serif;\">&ldquo;Story of This Life&rdquo; vlogger Esther Anderson made a funny video comparing autumn lovers and haters called &ldquo;<a style=\"list-style: none; margin: 0px; padding: 0px; border: 0px; box-sizing: inherit; color: #000000; text-decoration-line: none; box-shadow: #0dbe98 0px -2px 0px inset; transition: box-shadow 0.3s ease-out 0s, background-color 0.3s ease-out 0s;\" href=\"https://www.youtube.com/watch?v=9dcmoGOn188\" target=\"_blank\" rel=\"noopener noreferrer\" data-rapid-elm=\"context_link\" data-ylk=\"elm:context_link\" data-rapid-sec=\"{&quot;entry-text&quot;:&quot;entry-text&quot;}\" data-rapid_p=\"2\" data-v9y=\"1\">Fall Personalities</a>.&rdquo; Watch above for some relatable reactions.</p>\r\n<p style=\"list-style: none; margin: 0px 0px 20px; padding: 0px; border: 0px; box-sizing: inherit; font-size: 1.125rem; line-height: 1.75rem; font-family: ProximaNova, \'Noto Sans KR\', \'Helvetica Neue\', Helvetica, Roboto, Arial, \'ヒラギノ角ゴ Pro W3\', \'Hiragino Kaku Gothic Pro\', Osaka, メイリオ, Meiryo, \'ＭＳ Ｐゴシック\', \'MS PGothic\', sans-serif;\"><iframe src=\"//www.youtube.com/embed/wAjiEJxQaMo\" width=\"560\" height=\"314\" allowfullscreen=\"allowfullscreen\"></iframe></p>', '5e316d24ccc15.jpeg', 19, 1, 1, 1, NULL, '2020-01-29 18:31:48', '2020-01-30 18:22:48'),
