(20, 11, 'Citizenship law: Students, opposition step up protests', 'citizenship-law-students-opposition-step-up-protests', '<p><span style=\"color: #424242; font-family: sans-serif; font-size: 18px; letter-spacing: 0.34px;\">Demonstrations spread to Kerala, Telangana, Tamil Nadu, Assam, West Bengal; SC rejects plea to set up inquiry panel on crackdown in Jamia Milia, AMU</span></p>\n<h2><sub>Students, opposition leaders and activists across regions stepped up their protests against the contentious Citizenship (Amendment) Act on Tuesday even as at least 29 persons were arrested for violent clashes over the last couple of days in Jamia Millia Islamia and parts of UP. The Supreme Court rejected plea for setting up an inquiry panel to probe the violence.</sub></h2>\n<h2><sub>Under the new law, all <strong>except</strong> Muslims who have come from Pakistan, Bangladesh and Afghanistan till December 31, 2014 and are facing religious persecution will not be treated as illegal immigrants but given Indian citizenship.</sub></h2>\n<p>&nbsp;</p>', '5e329721f3418.jpg', 13, 1, 1, 1, NULL, '2020-01-30 15:43:14', '2020-01-30 18:35:00');
