(33, 16, 16, NULL, 'updated', 'articles', '{\"body\":\"<p><span style=\\\"color: #333333; font-family: -apple-system, Arial, Helvetica;\\\"><span style=\\\"font-size: 15px;\\\">The ghost of the Super Over came back to haunt New Zealand again as they wilted under pressure from a couple of winning positions to hand India the series on Wednesday (January 29).<\\/span><\\/span><\\/p>\\n<p><a href=\\\"https:\\/\\/www.youtube.com\\/watch?v=MJyKN-8UncM\\\">https:\\/\\/www.youtube.com\\/watch?v=MJyKN-8UncM<\\/a><span style=\\\"color: #333333; font-family: -apple-system, Arial, Helvetica;\\\"><span style=\\\"font-size: 15px;\\\"><br \\/><\\/span><\\/span><\\/p>\\n<p>&nbsp;<\\/p>\\n<p><a href=\\\"https:\\/\\/www.youtube.com\\/watch?v=MJyKN-8UncM\\\">go to<\\/a><\\/p>\\n<p><span style=\\\"color: #333333; font-family: -apple-system, Arial, Helvetica;\\\"><span style=\\\"font-size: 15px;\\\">The hosts had things in control in their chase of 180 thanks to a sensational masterclass on a slow Hamilton pitch from captain Kane Williamson, whose sublime 95 off 48 balls left them right on the brink of victory. However, Mohammed Shami produced a stunning final over, giving away just one run off the final four balls to take the game into a tie-breaker.<\\/span><\\/span><\\/p>\\n<p><span style=\\\"color: #333333; font-family: -apple-system, Arial, Helvetica;\\\"><span style=\\\"font-size: 15px;\\\">&nbsp;<\\/span><\\/span><\\/p>\\n<p><span style=\\\"color: #333333; font-family: -apple-system, Arial, Helvetica;\\\"><span style=\\\"font-size: 15px;\\\">Even there, New Zealand had the guiding hand of Williamson as the hosts were primed to get third time lucky on their Super Over record. Tim Southee got 17 runs to defend, and started well in his pursuit. But with 10 needed off two balls, he missed his lengths by significant margins and Rohit Sharma - the standout batsman for India - monstered a couple of sixes into the stands to seal New Zealand\'s fate and the series.<\\/span><\\/span><\\/p>\",\"status\":true,\"is_approved\":false,\"updated_at\":\"2020-01-29 11:33:41\"}', '2020-01-29 18:33:41', '2020-01-29 18:33:41'),
